DROP TRIGGER /*!50030 IF EXISTS */ `total_relatorio`;

DELIMITER $$

CREATE DEFINER = `root`@`localhost` TRIGGER `total_relatorio` AFTER INSERT ON `relatorio` FOR EACH ROW BEGIN
		
       IF(	(SELECT COUNT(rel.mes) FROM total_relatorio rel
			WHERE (rel.mes=MONTH(NEW.data_trabalho) AND  rel.ano=YEAR(NEW.data_trabalho) AND
			rel.servidor_cpf=NEW.servidor_cpf)	)) 	THEN
			
         UPDATE total_relatorio rel SET rel.quantidade=rel.quantidade+1 WHERE (rel.mes=MONTH(NEW.data_trabalho) AND  rel.ano=YEAR(NEW.data_trabalho) AND
			rel.servidor_cpf=NEW.servidor_cpf);
			
	   ELSE
	   
			
		END IF;
    END $$

DELIMITER ;

